import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import Form from './template/form/main';

serviceWorker.register();

const forminit = {
    id: '',
    class: '223',
    method: 'get',
    token: 'token',
    hash: 'hash',
    inputs: [
        {name: 'name', value: '张宇'},
        {name: 'sex', value: '男'},
        {name: 'text', value: '2018'},
        {name: 'work', type: 'textarea', value: '2018'},
        {
            name: 'select',
            type: 'select',
            default : '',
            opts: [
                {desc: '0', disable: true,},
                {desc: '1', value: '1'},
                {desc: '2', value: '1'},
                {desc: '3', value: '2'},
            ],
        },
    ],
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
